import React from 'react';
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table'

const Product = ({products}) => {

    return (
        <div>
            <BootstrapTable data={products} version='4'>
                <TableHeaderColumn isKey dataField='id'>Product ID</TableHeaderColumn>
                <TableHeaderColumn dataField='name'>Product Name</TableHeaderColumn>
                <TableHeaderColumn dataField='price'>Product Price</TableHeaderColumn>
                {/*<TableHeaderColumn dataField='price2'>Product Price</TableHeaderColumn>*/}
                {/*<TableHeaderColumn dataField='price3'>Product Price</TableHeaderColumn>*/}
                {/*<TableHeaderColumn dataField='price4'>Product Price</TableHeaderColumn>*/}
                {/*<TableHeaderColumn dataField='price5'>Product Price</TableHeaderColumn>*/}
                {/*<TableHeaderColumn dataField='price6'>Product Price</TableHeaderColumn>*/}
            </BootstrapTable>,
        </div>
    );
}


export default Product;
